export default (state = null, action) => {
    switch(action.type) {
        case 'ON_MAIN':
            return 'main';
        case 'ON_ABOUT':
            return 'about';
        case 'ON_LOCATION':
            return 'location';
        case 'ON_STAFF':
            return 'staff';
        case 'ON_OFFER':
            return 'offer';
        case 'ON_RESERVATION':
            return 'reservation';
        case 'OFF_PAGE':
            return null;
        default: 
            return state;
    }
}
